function animateValue(a,t,e,n){let s=null;const o=i=>{s||(s=i);const m=Math.min((i-s)/n,1);a.innerHTML=Math.floor(m*(e-t)+t),m<1&&window.requestAnimationFrame(o)};window.requestAnimationFrame(o)}function animateDecimals(a,t,e,n,s){let o=null;const i=m=>{o||(o=m);const u=Math.min((m-o)/n,1),r=u*(e-t)+t;a.innerHTML=r.toFixed(s),u<1&&window.requestAnimationFrame(i)};window.requestAnimationFrame(i)}const alumnosEgresados=document.getElementById("alumnosEgresados");animateValue(alumnosEgresados,0,800,2e3);const startupsCreadas=document.getElementById("startupsCreadas");animateValue(startupsCreadas,0,17,1e3);const startupsSimuladas=document.getElementById("startupsSimuladas");animateValue(startupsSimuladas,0,460,1500);